import '../assets/styles/Image.css'
import classNames from "classnames";

import GitHub from '../assets/github.png'


const Image = ({image, circle, logo}) => {

    image =''

    return (
        <>  
            <img src={GitHub} className={classNames({
                circle:circle,
                logo:logo,
            })} />
        </>
    )
}

export default Image
